__NUXT_JSONP__("/drugs/Angiogenesis_Inhibitor_JI-101", (function(a,b,c,d){return {data:[{drug:{slug:b,emaEpar:[],fdaDrugLabel:[],id:b,nciThesaurus:{casRegistry:a,chebiId:a,chemicalFormula:a,definition:"An orally active inhibitor of vascular endothelial growth factor receptor 2 (VEGFR2), platelet-derived growth factor receptor beta (PDGFRb), and the ephrin B4 receptor B4 (EphB4) with potential antiangiogenic and antineoplastic activities. Angiogenesis inhibitor JI-101 binds to and inhibits VEGFR2, PDGFRb and EphB4, which may inhibit tumor angiogenesis and, so, cellular proliferation in tumor cells overexpressing VEGFR2, PDGFRb and EphB4. The receptor tyrosine kinases VEGFR2, PDGFRb and EphB4 may be overexpressed in a number of different cancer cell types and may play crucial roles in tumor angiogenesis.",fdaUniiCode:"980M4N37DH",identifier:"C82413",preferredName:c,semanticType:"Pharmacologic Substance",subclassOf:["C1742","C1967"],synonyms:[c,"JI-101"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FAngiogenesis_Inhibitor_JI-101",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("","Angiogenesis_Inhibitor_JI-101","Angiogenesis Inhibitor JI-101","2021-10-30T13:46:00.493Z")));